import * as s from './Sidebar_style'

const Sidebar = () => {
    const backgroundImage = 'https://images.unsplash.com/photo-1569982175971-d92b01cf8694?ixlib=rb-1.2.1&ixid=MXwxMjA3fDB8MHxleHBsb3JlLWZlZWR8M3x8fGVufDB8fHw%3D&w=1000&q=80'
    const sidebarData = [
       {name:'about', to:'/', submenu:[]},
       {name:'Home', to:'/', submenu:[]},
       {name:'Category', to:'/', submenu:[]},
       {name:'contacs', to:'/', submenu:[]}
    ]
    const handleSidebarMenu = ()=>{
       {sidebarData.map((index,item)=>{
          return(
             <s.MenuItem>
                {item.name}
             </s.MenuItem>
          )
       })}
    }
    return ( 
        <s.Container backgroundImage={backgroundImage}>
           <s.sidebarHeader>
              Dashboard
           </s.sidebarHeader>
        </s.Container>
     );
}

export default Sidebar;
